import React, { useState } from "react";

export default function Updatearr(){
    const [search,setSearch]=useState("");

    const cancelSearch=()=>{
        setSearch("")
    }

    return(
        <div className="rowj">
            <form className="row jsutify-content-end">
                <label htmlFor="search" className="form-label">Pretrazi po nazivu:</label>
                <input className="form-control" 
                    type="text" 
                    id="search" 
                    name="search"
                    value={search}
                    onChange={(e)=>setSearch(e.target.value)}
                    style={{borderRadius:'20px'}}
                    ></input>
            </form>

        </div>
    );
};
